      </div>
    );
  }else if(display==='algo'){
    return(
      <div>
        <Navbar/>
        <AlgoHome receiveTrip={receiveTrip}/>
      </div>
    )
  }else if(display==='tripDisplay'){
    return(
      <div>
        <Navbar/>
        <Main trip={trip} receiveTrip={receiveTrip}/>
      </div>
    )
  }
}

export default App;
